import './App.css';
import LOGO from "./assets/logo.png"
/**
 * Header
 *  -Logo
 *  -nav-bar
 * Body
 *  -search
 *  -filter
 *  -sort
 *  -restraurants cards
 * Footer
 *  -links
 */

const Header = ()=>{
  return(
    <div className="header">
      <div className="log-cotainer">
        <img src={LOGO}/>
      </div>
      <div className="nav-items">
          <ul>
            <li>Home</li>
            <li>About us</li>
            <li>Contact Us</li>
            <li>Cart</li>
          </ul>
      </div>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Header/>
    </div>
  );
}

export default App;
